data:
  definition: ouverture pour la sortie d’un câble d’un connecteur ou boîtier
  examples: []
  notes:
  - La sortie de câble peut comporter des dispositions pour un serrage de câble, un
    anneau de pression, un écrou de pression, une sortie de passe-fil ou de l’écran;
    elle peut être droite ou coudée.
